import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';

@Component({
  selector: 'app-upload-data',
  templateUrl: './upload-data.component.html',
  styleUrls: ['./upload-data.component.css']
})
export class UploadDataComponent {

  public chosenFiles: File[] | null = null;

  sendFiles()
  {
    //this.http
  }
  constructor(public http: HttpClient) { }
}
<h1>Загрузка Excel файлов</h1>

<form enctype="multipart/form-data" method="POST" action="https://localhost:7145/WeatherApi">
  <p>Загрузите ваши таблицы на сервер</p>
  <p>
    <input type="file" name="excelTable" multiple [(ngModel)]="chosenFiles">
    <button (click)="sendFiles()">Отправить</button>
  </p>
</form>
